// client/src/App.js

import React from "react";
// import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Navbar"
import Table from "./Table";
import bootstrap from "bootstrap"

function App() {
  // const [data, setData] = {data: "FILL HERE!"}
  const [data, setData] = React.useState(null);

  fetch("http://localhost:9000/covid_data")
    .then(res => res.text())
    .then(res => setData(res));

  return (
    <div className="App">
      <Navbar />
      <p>{!data ? "App.js Loading data From Server" : data}</p>
      <Table />
    </div>
  );
}

export default App;
